// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "./ERC20.sol";

/*
How to swap tokens 1-1

1. Alice has 100 tokens from AliceCoin, which is a ERC20 token.
2. Bob has 100 tokens from BobCoin, which is also a ERC20 token.
3. Alice and Bob wants to trade 10 AliceCoin for 10 BobCoin.
4. Alice or Bob deploys TokenSwap
5. Alice approves TokenSwap to withdraw 10 tokens from AliceCoin
6. Bob approves TokenSwap to withdraw 10 tokens from BobCoin
7. Alice or Bob calls TokenSwap.swap()
8. Alice and Bob traded tokens successfully.
*/

// owner1: 0x5F735c31f814e677D04A0b8DEb3A494f3a0AdDe1
// tcbs1: 0x2F06BeeAD544D7eB52A1B02228FC5399c33c3f33
// owner2: 0xA88bCBE43308a7bE6767394E2E9E2074b8936f2d
// tcbs2: 0x24B497F228965F8841A16D70d2D304F9132098a1
// tokenSwap: 0xB5bF7A2E75e11fd3B653D199f76ab6d828c9c2C5
// 100000000000000000000
// 100000000000000000000

contract TokenSwap {
    IERC20 public token1;
    address public owner1;
    uint public amount1;
    IERC20 public token2;
    address public owner2;
    uint public amount2;

    constructor(
        address _token1,
        address _owner1,
        uint _amount1,
        address _token2,
        address _owner2,
        uint _amount2
    ) {
        token1 = IERC20(_token1);
        owner1 = _owner1;
        amount1 = _amount1;
        token2 = IERC20(_token2);
        owner2 = _owner2;
        amount2 = _amount2;
    }

    function swap() public {
        require(msg.sender == owner1 || msg.sender == owner2, "Not authorized");
        // require(
        //     token1.allowance(owner1, address(this)) >= amount1,
        //     "Token 1 allowance too low"
        // );
        // require(
        //     token2.allowance(owner2, address(this)) >= amount2,
        //     "Token 2 allowance too low"
        // );

        safeTransferFrom(token1, owner1, owner2, amount1);
        safeTransferFrom(token2, owner2, owner1, amount2);
    }

    function safeTransferFrom(
        IERC20 token,
        address sender,
        address recipient,
        uint amount
    ) private {
        bool sent = token.transferFrom(sender, recipient, amount);
        require(sent, "Token transfer failed");
    }
}

